#include <iostream>
#include <time.h>
#define size 10000
#define printSize 100

using namespace std;

void print(int *arr, string define)
{
    if (printSize > size)
    {
        cout << "Error!";
        return;
    }
    cout << define << '\n';
    cout << "[";
    for (int k = 0; k < printSize; k++)
    {
        cout << arr[k];
        if (k != printSize - 1)
        {
            cout << ",";
        }
    }
    if (printSize < size)
    {
        cout << " ...]\n";
    }
    else
    {
        cout << "]\n";
    }
}

void timeStamp(clock_t start, clock_t end)
{
    cout << "result : ";
    cout << (double)((end - start) / 1000);
    cout << "ms\n\n";
}

